import React from "react";
import Logo from "../images/logo.svg";

const HelloWorld = () => {
  return (
    <nav>
      <img src={Logo} alt="Logo" />

      <ul>
        <li>
          {" "}
          <a href="">About</a>{" "}
        </li>
        <a href="">Carrers</a>
        <a href="">Event</a>
        <a href="">Product</a>
        <a href="">Suport</a>
      </ul>
    </nav>
  );
};

export default HelloWorld;
